import React from 'react';
import IconText from '../iconText/IconText'
import InboxIcon from '@material-ui/icons/Inbox';
import StarIcon from '@material-ui/icons/Star';
import ScheduleIcon from '@material-ui/icons/Schedule';
import SendIcon from '@material-ui/icons/Send';
import DraftsIcon from '@material-ui/icons/Drafts';
import GroupIcon from '@material-ui/icons/Group';
import VideocamIcon from '@material-ui/icons/Videocam';
import MeetingRoomIcon from '@material-ui/icons/MeetingRoom';
function RightSideBarInbox(props) {
    return (
        <>
        <div className="right-side-box-inbox">
            <IconText text1="Inbox" text2="28,307" icon={InboxIcon}/>
            <IconText text1="Starred" text2="" icon={StarIcon}/>
            <IconText text1="Snooze" text2="" icon={ScheduleIcon}/>
            <IconText text1="Send" text2="" icon={SendIcon}/>
            <IconText text1="Draft" text="" icon={DraftsIcon}/>
            <IconText text1="LPS" text="" icon={GroupIcon}/>
            <IconText text1="LPS2" text="" icon={GroupIcon}/>
        </div>
        <span>Meet</span>
        <div className="right-side-box-socials">
            <IconText text1="New Meeting" icon={VideocamIcon}/>
            <IconText text="Join Meeting" icon={MeetingRoomIcon}></IconText>
        </div>
        </>

    );
}

export default RightSideBarInbox;
